import React from "react";

const Ava = (props) => {
  return (
    <>



<svg 
    fill={props.fill}
    height={`${props.size}px`}
    width={`${props.size}px`}
     viewBox="0 0 45 44" 
    >
<rect width="45" height="44" fill="#E5E5E5"/>
<g id="Frame 4" clip-path="url(#clip0_0_1)">
<rect width="1280" height="1274" transform="translate(-45 -220)" fill="#E5E5E5"/>
<rect id="Rectangle 17" x="-11" y="-15" width="386" height="476" rx="19" fill="white"/>
<ellipse id="Ellipse 7" cx="22.5" cy="22" rx="22.5" ry="22" fill="url(#pattern0)"/>
</g>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
</pattern>
<clipPath id="clip0_0_1">
<rect width="1280" height="1274" fill="white" transform="translate(-45 -220)"/>
</clipPath>

</defs>
</svg>
</>
);
};

export default Ava;
